function updateStatus(n,t,i){$.post("/Commerce/UpdateLogisticsRelationshipStatus",{invitationId:n,partnershipId:t,status:i},function(n){n.result?($("#groupbtn"+t).remove(),cleanBookNotification.success(_L("UPDATE_MSG_SUCCESS"),"Trader")):!n.result&&n.msg?cleanBookNotification.error(n.msg,"Trader"):cleanBookNotification.error(_L("ERROR_MSG_EXCEPTION_SYSTEM"),"Trader")})}